ing-only-javascript\n    var textFile = null;\n    function makeTextFile(text) {\n      var data = new Blob([text], {type: 'text/plain'});\n\n      // If we are replacing a previously generated file we need to\n      // manually revoke the object URL to avoid memory leaks.\n      if (textFile !== null) {\n        window.URL.revokeObjectURL(textFile);\n      }\n\n      textFile = window.URL.createObjectURL(data);\n\n      return textFile;\n    };\n\n    var link = document.createElement('a');\n    // link.setAttribute('download', 'exoplots_download.txt');\n    link.setAttribute('target', '_blank');\n    link.href = makeTextFile(makeCSV(sources, keys, header));\n    document.body.appendChild(link);\n\n    // wait for the link to be added to the document\n    window.requestAnimationFrame(function() {\n      var event = new MouseEvent('click');\n      link.dispatchEvent(event);\n      document.body.removeChild(link);\n    });\n    "}}]]]},"styles":{"type":"map","entries":[["margin","auto 5px"]]},"label":"Download CSV of Selected Data"}},{"type":"object","name":"Div","id":"p3319","attributes":{"styles":{"type":"map","entries":[["margin","auto -3px auto 5px"]]},"text":"Candidate:"}},{"type":"object","name":"ColorPicker","id":"p3320","attributes":{"js_property_callbacks":{"type":"map","entries":[["change:color",[{"type":"object","name":"CustomJS","id":"p3321","attributes":{"args":{"type":"map","entries":[["other",{"type":"object","name":"Scatter","id":"p3261","attributes":{"x":{"type":"field","field":"teq"},"y":{"type":"field","field":"met"},"size":{"type":"value","value":6},"line_color":{"type":"value","value":"#228833"},"line_alpha":{"type":"value","value":0.4},"fill_color":{"type":"value","value":"#228833"},"fill_alpha":{"type":"value","value":0.4},"hatch_color":{"type":"value","value":"#228833"},"hatch_alpha":{"type":"value","value":0.4}}}]]},"code":"other.fill_color = this.color"}},{"type":"object","name":"CustomJS","id":"p3322","attributes":{"args":{"type":"map","ent
